import React from "react";
import { Text, StyleSheet, View } from "react-native";

const ListScreen = () => {
  return <Text style={styles.text}>this is ListScreen</Text>;
};

const styles = StyleSheet.create({
  text: {
    fontSize: 30,
  },
});

export default ListScreen;
